import React,{useState} from "react";

function Navbar() {

function handleHome(){
  const elements = document.getElementsByClassName("home");
   elements[0].style.display="block";
}

function handleHome2(){
  const elements = document.getElementsByClassName("home");
   elements[0].style.display="none";
}

function handleAbout(){
  const elements = document.getElementsByClassName("about");
  elements[0].style.display="block";
}

function handleAbout2(){
  const elements = document.getElementsByClassName("about");
  elements[0].style.display="none";
}


    return (
      <div >
        <div className="navbar">
        <img src="/icons/nps_logo2.jpg"  alt="Logo"/>
          <ul>
            <li onMouseEnter={handleHome} onMouseLeave={handleHome2}><a href="/">Home</a>
            <ul className="home">
              <li>Messages</li>
              <li>More about NPS Shivpura</li>
              <li>Our Events and Activities</li>
              <li>Location</li>
            </ul>
            </li>
            <li onMouseEnter={handleAbout} onMouseLeave={handleAbout2}><a href="/about">About Us</a>
            <ul className="about">
              <li>History</li>
              <li>National Public School Shivapura At A Glance</li>
              <li>SCHOOL PROFILE</li>
            </ul>
            </li>
            <li><a href="/admissions">Admissions</a>
            <ul onM>
              <li>Welcome to National Public School, Shivpura.</li>
              <li>REGISTRATION FOR ADMISSION</li>
            </ul>
            </li>
            <li><a href="/learning">Learning</a></li>
            <li><a href="/campus">Our Campus</a></li>
            <li><a href="/contact">Contact Us</a></li>
          </ul>
        </div>
      </div>
    );
  }

export default Navbar
